    data: |
      SELECT DISTINCT - + 86 + - + col0 AS col2 FROM tab0 AS cor0 GROUP BY col0 HAVING NOT - ( - 22 ) NOT BETWEEN ( - + COUNT ( * ) ) * - - col0 - + AVG ( + - col2 ) AND 37;
  - name: tab0

outputs:
  - name: q8499.out
    data: |
      -129
      -169
